Wie man es mit dem [Spring Framework][1] verwendet
Der einfachste Weg ist, Spring-Konfigurations-XML automatisch zu generieren und einfach die obigen Konfigurationsparameter in der Kontext-XML-Datei hinzuzufügen.
Wenn Sie alle Validierungen selbst behandeln möchten, können Sie folgende Zeilen zur Konfiguration hinzufügen:
@Bean(name="validationProfile")
public Profile validationProfile(){
Profile profile = new Profile();
profile.getParams().put("ignore_field_missing", "false");
profile.put("messages_files","[Ihre benutzerdefinierte Nachrichtendatei]");
CustomRule rule = new CustomRule("meine.firma.MeineRegeln");
profile .registerCustomRule(rule);
returnprofile ;
}
